product = Product.create(user_id: user.id, store_id: store.id, price: 29.95, tags: '["Perfume"]', image_urls: '["https://i.etsystatic.com/32984883/r/il/795650/3533429061/il_fullxfull.3533429061_6wzl.jpg", "https://i.etsystatic.com/32984883/r/il/35f282/3485777802/il_fullxfull.3485777802_bty6.jpg", "https://i.etsystatic.com/32984883/r/il/4cb1d1/3533316705/il_fullxfull.3533316705_hiq4.jpg"]', title: 'BLUE ANGEL Scented Candle', quantity: 7, views: 0, num_favorers: 0, description: 'The exotic and unique fragrance of our Just Heaven Blue Angel Scented Candle is truly... HEAVENLY!\r\n\r\nInspired by the sensual designer perfume by Thierry Mugler, Blue Angel is recommended for romantic moods. \r\nThis popular favourite explores essences of honey, chocolate and caramel, blended with notes of vanilla, patchouli and sandalwood.\r\n\r\nThis is a sweet, feminine and light fragrance, perfect for a small room or for those of you who prefer subtle scents.\r\n\r\nTop Notes: Orange Zest, Lemon\r\nMiddle Notes: Honey, Chocolate\r\nBase Notes: Caramel, Patchouli\r\n\r\n\r\n\r\n\r\nThis scented candle is hand crafted with a lot of love as well as:\r\n\r\n \tQuality soy wax\r\n \tNatural cotton wick\r\n \tHeat resistant glass jar with a stunning white matt finish\r\n \tAnd a sexy white wooden lid ;-)\r\n\r\nKeeping the lid on your candle when not in use (and cooled) will protect it from dust and will preserve the fragrance.\r\nMake sure to reuse our beautiful jars and lids! You could use them to store jewellery, hair pins, as a pen or paint/makeup brush holder...\r\n\r\n\r\n\r\nNet weight (wax &amp; fragrance alone): approx. 270g\r\nTotal weight with jar &amp; lid: approx. 755g\r\nBurn time: up to 50 hours when used correctly.\r\nLearn how to burn and care for your candle properly in the &#39;Candle Care &amp; Safety&#39; tab above.\r\n\r\nView our full range of heavenly soy candles\xa0right here!\r\n\r\n\r\nFor a little bit of fun...\r\nI did not know French fashion designer Thierry Mugler was born in Strasbourg!\r\nStrasbourg is an insanely picturesque town in France, about 2 hours away from where I grew up so the Angel perfume was just meant to be for me.\r\nIt was love at first scent for me and I have been wearing it for the last 27 years!\r\nMugler created his first perfume, Angel, in 1992. It contains a combination of praline and chocolate mixed with a strong accord of patchouli which\xa0would be a part of a new fragrance type called &#39;gourmand&#39;.\r\nThe iconic Angel bottle, a design in the shape of a faceted star, was created by the Brosse Master Glassmakers and fans of the fragrance include\xa0Diana Ross,\xa0Barbara Walters,\xa0Eva Mendes, and\xa0Hillary Clinton (and Yours Truly, Mimi Bondi) :)\r\n(Source: Wikipedia)\r\nIf you ever visit France, I hope you will visit Strasbourg by the way! Check out what it&#39;s like below:\r\n\r\n\r\n\r\nWhat do you think of our Blue Angel scented Candle?\r\nIf you enjoyed it, please leave us a comment in the &quot;Reviews&quot; tab on this page, we&#39;d love to hear your feedback :)')
product = Product.create(user_id: user.id, store_id: store.id, price: 29.95, tags: '["Coffee Shop"]', image_urls: '["https://i.etsystatic.com/32984883/r/il/deb27e/3533403337/il_fullxfull.3533403337_rp39.jpg", "https://i.etsystatic.com/32984883/r/il/b2fa51/3533417431/il_fullxfull.3533417431_im7a.jpg", "https://i.etsystatic.com/32984883/r/il/a6f373/3485665764/il_fullxfull.3485665764_97yt.jpg"]', title: 'CHAI LATTE Scented Candle', quantity: 3, views: 0, num_favorers: 0, description: 'Inhale the exotic aroma of our Just Heaven Chai Latte Scented Candle and close your eyes...\r\n\r\nBreathe in the wonderful spicy chai tea scent, combined with a warm, creamy aroma...\r\nNotice the base of cinnamon and clove and subtle notes of black tea and vanilla bean.\r\n\r\nTop Notes: Black Tea, Cinnamon\r\nMiddle Notes: Clove, Fresh Milk\r\nBase Notes: Vanilla Bean, Musk\r\n\r\n\r\n\r\n\r\nThis scented candle is hand crafted with a lot of love as well as:\r\n\r\n \tQuality soy wax\r\n \tNatural cotton wick\r\n \tHeat resistant glass jar with a stunning white matt finish\r\n \tAnd a sexy white wooden lid ;-)\r\n\r\nKeeping the lid on your candle when not in use (and cooled) will protect it from dust and will preserve the fragrance.\r\nMake sure to reuse our beautiful jars and lids! You could use them to store jewellery, hair pins, as a pen or paint/makeup brush holder...\r\n\r\n\r\n\r\nNet weight (wax &amp; fragrance alone): approx. 270g\r\nTotal weight with jar &amp; lid: approx. 755g\r\nBurn time: up to 50 hours when used correctly.\r\nLearn how to burn and care for your candle properly in the &#39;Candle Care &amp; Safety&#39; tab above.\r\n\r\nView our full range of heavenly soy candles\xa0right here!\r\n\r\n\r\nFor a little bit of fun...\r\nDid you know the term &quot;chai&quot; originated from the Hindi\xa0word &quot;chai&quot;, which was derived from the\xa0Chinese\xa0word for tea,\xa0cha?\r\nIn English, this spiced tea is commonly referred to as\xa0masala chai, or simply\xa0chai, even though the term refers to\xa0tea\xa0in general in the original language.\r\nNumerous coffee houses use the term\xa0chai latte\xa0or\xa0chai tea latte\xa0for their version to indicate that it is made with steamed milk, much like that used to make a\xa0caff√® latte, but mixed with a spiced tea concentrate instead of\xa0espresso.\r\nBy 1994, the term had gained currency on the U.S. coffeehouse scene (source: Wikipedia)\r\nWant to make your own chai latte? Yes Please!!\r\n\r\nClick the image below for an easy recipe for you to follow...\xa0\r\nYou will need some cinnamon sticks, cardamom pods, cloves, peppercorns, anise, ginger...\r\nSome black tea bags, milk and brown sugar.\r\n\r\n\r\n\r\nWhat do you think of our Chai Latte\xa0scented Candle?\r\nIf you enjoyed it, please leave us a comment in the &quot;Reviews&quot; tab on this page, we&#39;d love to hear your feedback :)')
