product = Product.create(user_id: user.id, store_id: store.id, price: 7.5, tags: '["Remarkable 2", "Calendar", "Agenda", "Bullet journal", "Pdf", "Timetable", "Emploi du temps", "Link", "Month", "Bujo", "Tablet", "Calendrier", "hyperlink"]', image_urls: '["https://i.etsystatic.com/32982851/r/il/b1dc2b/3533333497/il_fullxfull.3533333497_7k8t.jpg", "https://i.etsystatic.com/32982851/r/il/9c1e37/3485681622/il_fullxfull.3485681622_i1qn.jpg", "https://i.etsystatic.com/32982851/r/il/f09bb1/3485681198/il_fullxfull.3485681198_54mv.jpg", "https://i.etsystatic.com/32982851/r/il/ab71c1/3485681916/il_fullxfull.3485681916_kfpq.jpg", "https://i.etsystatic.com/32982851/r/il/41da2f/3533466701/il_fullxfull.3533466701_117m.jpg", "https://i.etsystatic.com/32982851/r/il/1e7f75/3485820734/il_fullxfull.3485820734_ds1j.jpg"]', title: 'Bullet Journal for my paper tablet - Remarkable 2 optimized', quantity: 500, views: 2, num_favorers: 0, description: 'You just found your Bullet Journal for your paper tablet (Remarkable 2 of course).\nEasy to use, Pr√™t √† l&#39;emploi and hugely customizable. \n\nYou will buy an Interactive PDF optimized for Remarkable 2 in landscape mode (but you could as well print it) : 485 pages in total.\n\nWe&#39;ve been using this for 10 months now... and we&#39;re going to use it for a very long time because it has been preset to be used for ANY YEAR : 2021 and beyond.\nIt&#39;s time for you to be productive, and you&#39;ll find plenty of room for you to be creative in your own Bullet Journal.\n\n- What will you get ? -\n&gt; 1 &quot;Bullet Journal for your paper tablet&quot; cover\n&gt; 1 blank cover to draw your own\n&gt; 3 Double Index pages (with HYPERLINKS to every other pages) : 126 entries\n&gt; 1 Future log (year page)\n&gt; 12 month pages (day numbers to be set on the left, TODOS on the right)\n&gt; 464 daily or collection pages (because you can use several page a day or for 1 collection)\n&gt; 2 blank back covers\n\nEvery pages has a HYPERLINK to go back to INDEX.\nEvery pages is designed to allow your side bar to appear seamingless.\n\nFor now : in French .\nSoon : in English, Spanish and Italian.\nContact us if you are in a hurry to get one particular translation or an other language.\n\n- How to install it ? -\nJust import your PDF File into your Remarkable 1 or 2.\n\n- HINT about the INDEX -\nUse the INDEX to order your collections. \nA collection is composed of several written pages on 1 particular subject.\nYou can start and continue a collection on any page, just add its page numbers in the INDEX (&quot;pp. 151 - 166&quot; OR &quot;pp. 151 ; 165 - 166 ; 188&quot;). \nThroughout the year, you can write down how much you love Bonsa√Ø, describe every tree you grow and retrieve previous pages from the index. \nThis way, your Bullet Journal will store your yearly thoughts and writings. \n\n- HINT about the MONTH VIEWS -\nAdd each day numbers on the left page side : on one of the 31 lines (1, 2, 3, ... , 31).\nOn each day line, you can write down your rendez-vous and birthdays.\nOn the right side : your TODOS for the months.\nAt the end of each month, be sure to report all the task you didn&#39;t do yet onto next months pages.\n[X] Done\n[&gt;] Rescheduled (onto a month page)\n[&lt;] Rescheduled (onto the year page)\n\n- HINT for daily pages -\n[!] Important shit\n[-] Notes\n[X] Todos\n[?] You need to dig into that\n\n- HINT to use it forever -\nYou can w r i t e down year, dates, page numbers, and collections with your marker.\nNext year, just import a fresh Bullet Journal PDF file into your Remarkable.\n\n&gt; If you need any help or a customised file (or format or translation or police), please contact us. &lt;\n\nPS : Our studio is only composed by myself.\nI&#39;m using my dad&#39;s Old Remarkable 1.\nI need to sell this 76 times to be able to buy myself a Remarkable 2 brand new !\nAfter 76 items sold, i will sell it at a lesser price.\nThanks for reading me !')

