velope, a map of Fairyland, a wish bag and a &#39;Summon the Fairies&#39; Poem. \n\nPlease use the picture guides included to construct your unique personalised letter, using the &#39;personalise&#39; space to write your chosen options, so we can make your letter extra personal and special.\nIf you have any requests or questions please feel free to send me a message and I will get back to you!\n\nThe letters are sent in a separate envelope, ready to open and place under a pillow or by the letterbox.\n\nIf you are not sure on the options, and want to include little or no personalisation but would still like originality, please write &#39;choose for me&#39; in the &#39;personalise&#39; space. \nIf you would like the set option, a universal set letter without personalisation,  please find this on EnchantedPost as a separate listing (coming soon).')

