product = Product.create(user_id: user.id, store_id: store.id, price: 30.0, tags: '["Turkish", "Turkish Coffee", "Coffee", "Arabica Beans", "Very Roasted", "Roasted", "Turkish Traditional"]', image_urls: '["https://i.etsystatic.com/32976681/r/il/5bdb86/3484523274/il_fullxfull.3484523274_6sxn.jpg", "https://i.etsystatic.com/32976681/r/il/5e4e64/3532027245/il_fullxfull.3532027245_6jp9.jpg", "https://i.etsystatic.com/32976681/r/il/b25e74/3484523388/il_fullxfull.3484523388_a82p.jpg", "https://i.etsystatic.com/32976681/r/il/997118/3484376744/il_fullxfull.3484376744_k8f0.jpg"]', title: 'Turkish Coffee 250g (Very Roasted)', quantity: 20, views: 8, num_favorers: 0, description: 'Turkish coffee is one of the oldest coffee preparation and cooking methods that has survived from the Ottoman Empire, which has an important place in Turkish culture. \n\nIt has a unique identity and tradition with its unique taste, foam, smell and presentation style. It is the only type of coffee served with its grounds.\n\n‚Äì Dark Roast \n\nWith highly roasted Turkish coffee, we reveal bitter, spicy, woody and earthy flavor aromas, prevent the aging of the beans with a very special roasting process, and preserve its freshness and aroma.\n\n‚Äì Medium Roast \n\nWith medium roasted Turkish coffee, you can erode the aromas, aromas of spicy, woody, fruity and flavorful flavors, and control the age of the beans with a very special process.\n\n‚Äì Mastic Flavored\n\nWith a very special roasting process, we prevent the aging of the beans and preserve their freshness and aroma. Turkish coffee served with the unique aroma and taste of mastic is now at your door with a click!\n\n‚Äì Nutritional Values\n\nEnergy (kcal)/(kJ) 380/1588\nFat (g) 16.6\nSaturated Fat (g) 7.2\nUnsaturated Fat (g) 0\nCarbs(g) 18.9\nSugar(g) 1.6\nFiber(g) 50.5\nProtein (g) 13.4\nSalt(g) 0\n\nPREPARING TURKISH COFFEE:\n\n1- Add water to the cezve (ibrik), about 50 milliliters (1.7 oz) per cup of coffee desired\n2- Add sugar to taste, stirring to blend it\n3- Bring to a boil, remove from heat and add a teaspoon of coffee per cup\n4- Boil coffee.  \n5- Remove the cevze from heat immediately after bringing to a first boil, discarding the accumulated foam, and mix well.\n6- The coffee is boiled twice in succession, taking care to remove the cezve from the heat between one boiling and the next. The foam can either be discarded or kept before stirring it well\n7- Allow remaining powder to settle before serving.  You can add a tablespoon of cold water to the pot after boiling twice to accelerate the process.')

