product = Product.create(user_id: user.id, store_id: store.id, price: 55.0, tags: '["Embroidery", "Photography", "Nature", "Art", "stitch", "contemporary craft", "craft", "local makers", "textiles art", "abstract art", "original art", "machine stitch", "ambleside"]', image_urls: '["https://i.etsystatic.com/32971991/r/il/375cfb/3531598549/il_fullxfull.3531598549_m464.jpg", "https://i.etsystatic.com/32971991/r/il/1d8347/3483939088/il_fullxfull.3483939088_rzcy.jpg", "https://i.etsystatic.com/32971991/r/il/8d9faa/3483939202/il_fullxfull.3483939202_t6zn.jpg", "https://i.etsystatic.com/32971991/r/il/87bd97/3483939322/il_fullxfull.3483939322_1j3j.jpg", "https://i.etsystatic.com/32971991/r/il/930029/3483939264/il_fullxfull.3483939264_bf35.jpg", "https://i.etsystatic.com/32971991/r/il/e04848/3531586545/il_fullxfull.3531586545_gcyc.jpg"]', title: 'Ambleside Series : Wrap', quantity: 1, views: 2, num_favorers: 0, description: 'I take photos of the natural word around me. I edit and print them before machine stitching with a mix of vintage and more threads.\n\nMy pieces play on my love of nature and my Lancashire textiles heritage. I&#39;m interested in the lines made by grasses, branches and foliage and how they mirror the forms of thread and stitch. \n\nThe work comes signed, mounted and framed. It is entirely original. No two pieces will be the same. \n\nThe frame is pretty robust but is perspex not glass. This helps with safety and cost for postage. You could easily re-frame the piece once you had it if you felt necessary. Draft draft draft')
