dles. We only use 100% soy wax which is from environmentally friendly, renewable resources mixed with clean candle fragrances free of carcinogens, phthalate, parabens, and reproductive toxins. Haus of Wool candles are truly unique because we blend fragrances together to create a custom scent that is directly inspired by a place, a memory or a feeling that is personal to us.')
