est qualities and showcase your commitment to your future job. This modern resume template package features a 2-page sleek design. Your Resume can be instantly downloaded, edited, printed, or digitally uploaded to a job posting.\n\n\n‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨\n\n\n‚òÖ C O N T E N T S\n\n\n- A two-page resume template\n- One cover letter template in canvas that can be shared to .docx format (MS Word), \n- Two Resume formats in A4 and US Letter.\n- Full Customer Support. If you have any troubles at all editing your template, feel free to send a direct message to us, and we will do everything we can to help!\n\n\n‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨\n\n\n‚òÖ F E A T U R E S\n\n- EASILY EDITABLE - Everything is fully editable (you can change colors, shapes, sizes, positions, fonts, etc...). This is all easily explained in the user Instructional Guide/FAQ.\n- PROFESSIONALISM - All of our Resumes are designed to show your pashion and dedication to your future job by using modern detailing but at the same time being easily accessible.\n- SUPPORT - If you need help with ANYTHING in the design of your resume, we will help you until your Resume is exactly what you are looking for, even if we have to personally edit your Resume and send it to you!\n\n\n‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨‚ñ¨\n\n\n‚òÖ P U R C H A S E P R O C E S S\n\n\n1. Add this listing to your cart. Upon purchase, you will receive all of the files in a ZIP file. Simply unzip the file and place all of the contents into a folder of your choosing.\n2. Download and install all the required fonts used in the template. You will receive an instructional file labeled &quot;FontInstall.pdf&quot;, providing a link to the font used, as well as a guide on how to install the fonts to your computer for your specific operating system.\n3. Open your resume file in Canva and share it to Google Drive (press 3 dots at top