product = Product.create(user_id: user.id, store_id: store.id, price: 12.5, image_urls: '["https://i.etsystatic.com/32966244/r/il/795554/3532160839/il_fullxfull.3532160839_ij1z.jpg"]', title: 'Savile Row Reproduction London Rustic Street Sign', quantity: 34, views: 0, num_favorers: 0, description: 'A beautiful reproduction Saville Row street sign. Made from solid wood. Would look fantastic displayed in a closet or bedroom ‚Äì wherever you keep your best suits!\n\nSavile Row is a street in Mayfair, central London. Known principally for its traditional bespoke tailoring for men, the street has had a varied history that has included accommodating the headquarters of the Royal Geographical Society at 1 Savile Row, where significant British explorations to Africa and the South Pole were planned; and more recently, the Apple office of the Beatles at 3 Savile Row, where the band‚Äôs impromptu final live performance was held on the roof of the building.')
product = Product.create(user_id: user.id, store_id: store.id, price: 12.5, image_urls: '["https://i.etsystatic.com/32966244/r/il/f38616/3532156339/il_fullxfull.3532156339_mhx2.jpg"]', title: 'Pudding Lane Reproduction London Rustic Street Sign', quantity: 99, views: 0, num_favorers: 0, description: 'A beautiful reproduction Pudding Lane street sign. Made from solid wood, rustically painted off white and black, faded to give a great antique look. Would look fantastic displayed in a kitchen or pantry ‚Äì wherever you spend your time making your best desserts!\n\nPudding Lane, previously known as Rother Lane, or Red Rose Lane, is a small street in London, widely known as the location of Thomas Farriner‚Äôs bakery, where the Great Fire of London started in 1666. It runs between Eastcheap and Thames Street in the historic City of London, and intersects Monument Street, the site of Christopher Wren‚Äôs Monument to the Great Fire.')
