product = Product.create(user_id: user.id, store_id: store.id, price: 20.0, tags: '["houseplant", "chinese evergreen", "aglaonema", "aglaonema maria", "silver evergreen", "rare plants", "drought tolerant"]', image_urls: '["https://i.etsystatic.com/32965721/r/il/a50cdf/3530662451/il_fullxfull.3530662451_c0d0.jpg", "https://i.etsystatic.com/32965721/r/il/ebc0bb/3485663130/il_fullxfull.3485663130_hvcj.jpg", "https://i.etsystatic.com/32965721/r/il/b23901/3485663096/il_fullxfull.3485663096_thp1.jpg"]', title: 'Aglaonema &quot;Maria Christina&quot; Chinese Evergreen', quantity: 1, views: 2, num_favorers: 1, description: 'Aglaonema Maria Christina (Chinese Evergreen) is an evergreen, ornamental, indoor house plant. It has the well-known pale green central foliage of Aglaonema Silver Queen but with a more pronounced darker green leaf margin and more splashes of darker green chevrons.\n\nThis is a hearty plant that can tolerate neglect. Low light and long absences are no problem for this evergreen.')
