product = Product.create(user_id: user.id, store_id: store.id, price: 15.0, tags: '["pothos", "houseplant", "rare houseplant", "vining plant", "epipremnum", "pearls and jade", "aroid", "rare aroid", "rare pothos"]', image_urls: '["https://i.etsystatic.com/32965721/r/il/0d9620/3530540857/il_fullxfull.3530540857_8nx9.jpg", "https://i.etsystatic.com/32965721/r/il/59a31d/3530539261/il_fullxfull.3530539261_t2gn.jpg", "https://i.etsystatic.com/32965721/r/il/16bfd3/3482892142/il_fullxfull.3482892142_296b.jpg"]', title: 'Pearls and Jade Pothos', quantity: 1, views: 1, num_favorers: 1, description: 'A beautiful trailing plant with unique patchy green and white leaves, the Pearls and Jade pothos is a great addition to any collection. The vines can grow 8-10 feet.\n\nPearls and Jade is a cultivar of Pothos, belonging to the genus Epipremnum. The leaves are on the smaller side for a pothos, growing to only about three inches in length at their peak.\n\nA low-maintenance plant, this pothos can tolerate low light, but will grow faster and have more color variety with brighter light.')
product = Product.create(user_id: user.id, store_id: store.id, price: 45.0, tags: '["plant", "houseplant", "monstera", "monstera peru", "Karstenianum", "rare houseplant", "rare plant", "climbing plant"]', image_urls: '["https://i.etsystatic.com/32965721/r/il/804e58/3482883364/il_fullxfull.3482883364_h8g8.jpg", "https://i.etsystatic.com/32965721/r/il/8b94e9/3530530899/il_fullxfull.3530530899_9k5l.jpg"]', title: 'Monstera Peru (Monstera Karstenianum)', quantity: 4, views: 1, num_favorers: 1, description: 'The Monstera Karstenianum, more commonly known as the Monstera Peru, is a rare plant that looks like a Monstera but acts like a succulent. It doesn‚Äôt grow very large, and has vibrant glossy, green leaves that feel leathery to the touch. They also have a gorgeous deep green veining on the leaves.\n\nThe more mature the plant gets, the deeper and darker the veins will get. Unlike the Monstera Deliciosa and Monstera Adansonii, this variety doesn‚Äôt have any holes or fenestrations (splits) in the leaves.\n\nThe Monstera Peru is a hemiepiphyte, which means it lives part of its life in nature independently, and the other part growing atop other plants and trees. It is low-maintenance, doesn‚Äôt require much special attention, and looks stunning.')
product = Product.create(user_id: user.id, store_id: store.id, price: 45.0, tags: '["plant", "rare houseplants", "vining houseplants", "monstera", "swiss cheese plant", "monstera adansonaii", "holiday gift", "climbing plant", "aroid"]', image_urls: '["https://i.etsystatic.com/32965721/r/il/6d2ced/3530515155/il_fullxfull.3530515155_dk91.jpg"]', title: 'Monstera Adansonaii (swiss cheese plant) with Rustic Silver Pot', quantity: 2, views: 0, num_favorers: 1, description: 'Monstera Adansonaii in a farmhouse rustic decorative pot. This Monstera variety rewards you with leaf fenestrations from the get-go. This is an epiphytic vining plant that can trail or climb. If you give it a moss pole to climb, the leaves will grow larger and more fenestrated.\n\nThe Monstera Adansonaii can handle low to medium light, but will grow more quickly with more light. \n\nThe decorative, farmhouse pot makes this plant gift-ready for the holidays!')
product = Product.create(user_id: user.id, store_id: store.id, price: 45.0, tags: '["philodendron", "silver sword", "hastatum", "aroid", "rare plant", "philo silver sword", "plants", "epiphyte", "climbing plant", "rooted cutting", "propagated plant"]', image_urls: '["https://i.etsystatic.com/32965721/r/il/a0c447/3482824228/il_fullxfull.3482824228_3m8c.jpg", "https://i.etsystatic.com/32965721/r/il/0e91e1/3482824220/il_fullxfull.3482824220_92cn.jpg", "https://i.etsystatic.com/32965721/r/il/799a57/3530471145/il_fullxfull.3530471145_8ypr.jpg"]', title: 'Philodendron Silver Sword (Hastatum)', quantity: 1, views: 0, num_favorers: 1, description: 'Philodendron hastatum is a vine in the Aroid family, which means it comes with all the usual advantages of simple care, easy propagation and multiple ways to grow it. It&#39;s an epiphytic vine - so it will grow to full maturity with a pole to climb.\n\nWhether you want a trailing plant or a huge-leafed climber ‚Äì you can have it all. This philodendron handles everything down to lower light conditions pretty well. You should be totally fine positioning this plant a little farther from a light source into a room, but it will grow faster with more light.')

