ap&quot; or &quot;Hemp Wrap&quot; refers to the wrapping around the top of the &quot;Krystal&quot;.\n&quot;Wire Loop&quot; refers to the loop that the cord will be tied through.\n&quot;Cord&quot; refers to the either leather or hemp cording that make up the necklace.')
